  INDEX `idx_head_id_card`(`head_id_card` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 201 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '户籍表' ROW_FORMAT = Dynamic;

