  INDEX `idx_user_id`(`user_id` ASC) USING BTREE,
  INDEX `idx_real_name`(`real_name` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 451 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '居民表' ROW_FORMAT = Dynamic;

